import React from 'react';

const VideoPlayer = ({ src, ...props }) => {
  return (
    <div>
      <video controls {...props}>
        <source src={src} type="video/mp4" />
        Your browser does not support the video tag.
      </video>
    </div>
  );
};

export default VideoPlayer;
